'''Lieutenant Schepbur''' is a [[gnome]] found at the [[Khazard Battlefield]]. He commands the battle [[tortoise]]s, and even wears a tortoise shell as [[armour]]. He also mentions that more tortoises will be sent from the [[Tree Gnome Stronghold]], as they are being trained there. He wears a tortoise shell at his back, and has a golden [[mace]]-like [[weapon]] that is shaped like a flattened tortoise.

